    Function(api_name='sendChatAction', imports=[], link='https://core.telegram.org/bots/api#sendchataction', description='Use this method when you need to tell the user that something is happening on the bot\'s side. The status is set for 5 seconds or less (when a message arrives from your bot, Telegram clients clear its typing status). Returns True on success.\n\nExample: The ImageBot needs some time to process a request and upload the image. Instead of sending a text message along the lines of "Retrieving image, please wait…", the bot may use sendChatAction with action = upload_photo. The user will see a "sending photo" status for the bot.\n\nWe only recommend using this method when a response from the bot will take a noticeable amount of time to arrive.', returns=Variable(api_name=None, name=None, pytg_name=None, types=[Type(string='bool', is_builtin=True, always_is_value='True', is_list=0, import_path=None, description=None)], optional=None, default=None, description='Returns True on success'), parameters=[Variable(api_name='chat_id', name='chat_id', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None), Type(string='str', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=False, default=None, description='Unique identifier for the target chat or username of the target channel (in the format @channelusername)'), Variable(api_name='action', name='action', pytg_name=None, types=[Type(string='str', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=False, default=None, description='Type of action to broadcast. Choose one, depending on what the user is about to receive: typing for text messages, upload_photo for photos, record_video or upload_video for videos, record_audio or upload_audio for audio files, upload_document for general files, find_location for location data, record_video_note or upload_video_note for video notes.')], keywords=[]),
    Function(api_name='getUserProfilePhotos', imports=[], link='https://core.telegram.org/bots/api#getuserprofilephotos', description='Use this method to get a list of profile pictures for a user. Returns a UserProfilePhotos object.', returns=Variable(api_name=None, name=None, pytg_name=None, types=[Type(string='UserProfilePhotos', is_builtin=False, always_is_value=None, is_list=0, import_path='pytgbot.api_types.receivable.media', description=None)], optional=None, default=None, description='Returns a UserProfilePhotos object'), parameters=[Variable(api_name='user_id', name='user_id', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=False, default=None, description='Unique identifier of the target user')], keywords=[Variable(api_name='offset', name='offset', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=True, default=None, description='Sequential number of the first photo to be returned. By default, all photos are returned.'), Variable(api_name='limit', name='limit', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=True, default=None, description='Limits the number of photos to be retrieved. Values between 1—100 are accepted. Defaults to 100.')]),
    Function(api_name='getFile', imports=[], link='https://core.telegram.org/bots/api#getfile', description="Use this method to get basic info about a file and prepare it for downloading. For the moment, bots can download files of up to 20MB in size. On success, a File object is returned. The file can then be downloaded via the link https://api.telegram.org/file/bot<token>/<file_path>, where <file_path> is taken from the response. It is guaranteed that the link will be valid for at least 1 hour. When the link expires, a new one can be requested by calling getFile again.\nNote: This function may not preserve the original file name and MIME type. You should save the file's MIME type and name (if available) when the File object is received.", returns=Variable(api_name=None, name=None, pytg_name=None, types=[Type(string='File', is_builtin=False, always_is_value=None, is_list=0, import_path='pytgbot.api_types.receivable.media', description=None)], optional=None, default=None, description='On success, a File object is returned'), parameters=[Variable(api_name='file_id', name='file_id', pytg_name=None, types=[Type(string='str', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=False, default=None, description='File identifier to get info about')], keywords=[]),
    Function(api_name='kickChatMember', imports=[], link='https://core.telegram.org/bots/api#kickchatmember', description='Use this method to kick a user from a group, a supergroup or a channel. In the case of supergroups and channels, the user will not be able to return to the group on their own using invite links, etc., unless unbanned first. The bot must be an administrator in the chat for this to work and must have the appropriate admin rights. Returns True on success.', returns=Variable(api_name=None, name=None, pytg_name=None, types=[Type(string='bool', is_builtin=True, always_is_value='True', is_list=0, import_path=None, description=None)], optional=None, default=None, description='Returns True on success'), parameters=[Variable(api_name='chat_id', name='chat_id', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None), Type(string='str', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=False, default=None, description='Unique identifier for the target group or username of the target supergroup or channel (in the format @channelusername)'), Variable(api_name='user_id', name='user_id', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=False, default=None, description='Unique identifier of the target user')], keywords=[Variable(api_name='until_date', name='until_date', pytg_name=None, types=[Type(string='int', is_builtin=True, always_is_value=None, is_list=0, import_path=None, description=None)], optional=True, default=None, description='Date when the user will be unbanned, unix time. If user is banned for more than 366 days or less than 30 seconds from the current time they are considered to be banned forever')]),
